import React from 'react';
import Genres from './components/Genres';
import Authors from './components/Authors';
import Mangas from './components/Mangas';
import Reviews from './components/Reviews';
import './App.css';

function App() {
    return (
        <div className="App">
            <h1>Manga App</h1>
            <Genres />
            <Authors />
            <Mangas />
            <Reviews />
        </div>
    );
}

export default App;
